import React from "react";

function Nav() {
  return (
    <div className="nav">
      <img
        className="nav_logo"
        src="https://upload.wikimedia.org/wikipedia/commons/0/0f"
        alt="netflix logo"
      />
    </div>
  );
}

export default Nav;
